import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: 'e1', 
      title: 'Furiture', 
      amount: '94.08', 
      date: new Date (2023, 7, 15),
    },
    {
      id: 'e2', 
      title: 'Paint', 
      amount: '87.08', 
      date: new Date (2022, 7, 15),
    },
    {
      id: 'e3', 
      title: 'Wood',
      amount: '178.08', 
      date: new Date (2021, 7, 15),
    },
  ];

  return (
    <div>
      <h2>Let's get started in REACT!</h2>
      <ExpenseItem
        title = {expense[0].title}
        amount = {expense[0].amount}
        date = {expense[0].date}
        ></ExpenseItem>
      <ExpenseItem
        title = {expense[1].title}
        amount = {expense[1].amount}
        date = {expense[1].date}
        ></ExpenseItem>
      <ExpenseItem
        title = {expense[2].title}
        amount = {expense[2].amount}
        date = {expense[2].date}
        ></ExpenseItem>
    </div>
  );
}

export default App;
